import React from "react";
import "./User.css";

const User = ({user}) => {
	const { name, profile_pic, status, user_id } = user;

	return(
		<div className="User" key={user_id}>
			<img key={user_id} src={profile_pic} alt={name} className="User_pic" />
			<div key={user_id} className="User_details">
				<p className="User_details-name">{name}</p>
				<p className="User_details-status">{status}</p>
			</div>
		</div>
	);
}

export default User;
